import { useDispatch } from 'react-redux'
import { Navigate } from 'react-router-dom'
import { LoaderAction } from '../../Redux/Actions/LoaderAction'
import TaskShow from './AddTask/TaskShow'

function AfterLogin() {
    const disptach = useDispatch()
    const logout = ({ children }: { children: JSX.Element })=>{
        if (sessionStorage.getItem("UserLogin") != "null" && sessionStorage.length!=0) {
            return children
        }
         
          return <Navigate to="/Login" replace/>
    
    }
  return (
    <>
    <nav className="navbar navbar-light bg-light">
  <div className="container-fluid">
    <a className="navbar-brand">To Do</a>
    <logout> <button className="btn btn-danger" type="submit" ></button></logout>
     
  </div>
</nav>
    <div className="container">
    <TaskShow/>
    </div>
    
    </>
   
  )
}

export default AfterLogin
